gNj(){return"Papyrus 43 is New Testament manuscript. It consists of light-colored papyrus fragment measuring approximately 4 \xd7 7 cm, with text from the Book of Revelation preserved on both sides."},
gNk(){return"The text is written in Greek using two inelegant sloping hands and follows scriptio continua (continuous writing without spaces). The writing on the verso is oriented in the opposite direction to that on the recto."},
