gOE(){return"The manuscript is written in a formal uncial script (biblical majuscule) in Greek, featuring scriptio continua (continuous script without spaces between words). The text is arranged in columns: four columns per page in the New Testament and two per page for poetic texts. It also includes carefully regulated line breaks, nomina sacra, and distinctive punctuation."},
gOC(){return"Codex Sinaiticus was discovered in 1844 at Saint Catherine\u2019s Monastery on the Sinai Peninsula by Constantin von Tischendorf."},
gOy(){return"From a textological perspective, Codex Sinaiticus belongs to the Alexandrian text-type and is classified as Category I among New Testament manuscripts."},
gOA(){return"Today, parts of the codex are preserved in several institutions: primarily in the British Library (London), as well as in the Leipzig University Library, Saint Catherine\u2019s Monastery (Sinai), and the National Library of Russia (Saint Petersburg)."},
gON(){return"Codex Alexandrinus (A 02)"},
gOJ(){return"5th century AD"},
gOH(){return"The entire book of Revelation."},
gOL(){return"Codex Alexandrinus is written on parchment (vellum) made from thin, high-quality material. It consists of 773 folios, each measuring approximately 32 \xd7 26 cm, originally gathered into quires (typically eight leaves per quire). The manuscript comprises four volumes: three containing the Septuagint (Old Testament) and one containing the New Testament."},
gOM(){return"The text is written in an elegant uncial script in Greek, arranged in two columns per page, with 49-51 lines per column and approximately 20-25 letters per line. It follows scriptio continua (without spaces), with red ink used for the initial lines of each book and decorative tailpieces at the end of each book. Occasional punctuation marks and annotations (e.g., enlarged initials indicating new sections) are present."},
gOK(){return"Codex Alexandrinus takes its name from Alexandria, Egypt, where it was kept for some time. In the 17th century, Patriarch Cyril Lucaris brought it from Alexandria to Constantinople and later presented it to Charles I of England."},
gOG(){return"Textually, the codex exhibits a mixed character: the Gospels reflect the Byzantine text-type (Category III), while the rest of the New Testament belongs to the Alexandrian text-type (Category I)."},
