gOT(){return"\u041a\u043e\u0434\u0435\u043a\u0441 \u0415\u0444\u0440\u0435\u043c\u0430 - \u044d\u0442\u043e \u043f\u0430\u043b\u0438\u043c\u043f\u0441\u0435\u0441\u0442 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u0439 \u0411\u0438\u0431\u043b\u0438\u0438, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0435. \u041e\u043d \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 209 \u043b\u0438\u0441\u0442\u043e\u0432 \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 33 x 27 \u0441\u043c, \u0438\u0437 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 145 \u043b\u0438\u0441\u0442\u043e\u0432 \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f \u043a \u041d\u043e\u0432\u043e\u043c\u0443 \u0417\u0430\u0432\u0435\u0442\u0443 \u0438 64 \u043a \u0412\u0435\u0442\u0445\u043e\u043c\u0443 \u0417\u0430\u0432\u0435\u0442\u0443."},
gOU(){return"\u0422\u0435\u043a\u0441\u0442 \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u0441\u0440\u0435\u0434\u043d\u0438\u043c \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0443 \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u043f\u0438\u0441\u044c\u043c\u043e\u043c \u043d\u0430 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u043c \u044f\u0437\u044b\u043a\u0435, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u043c \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435 \u0441 40-46 \u0441\u0442\u0440\u043e\u043a\u0430\u043c\u0438 \u0432 \u043a\u043e\u043b\u043e\u043d\u043a\u0435. \u041a\u043e\u0434\u0435\u043a\u0441 \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0443 scriptio continua \u0431\u0435\u0437 \u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0441\u043b\u043e\u0432, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f \u0442\u043e\u043b\u044c\u043a\u043e \u043e\u0434\u043d\u0443 \u0442\u043e\u0447\u043a\u0443 \u0434\u043b\u044f \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0438\u0438, \u0438 \u0438\u043c\u0435\u0435\u0442 \u0443\u0432\u0435\u043b\u0438\u0447\u0435\u043d\u043d\u044b\u0435 \u0431\u0443\u043a\u0432\u044b \u0432 \u043d\u0430\u0447\u0430\u043b\u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u043e\u0432, \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u044e\u0449\u0438\u0435 \u043d\u0430 \u043f\u043e\u043b\u044f. \u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u0432\u043a\u043b\u044e\u0447\u0430\u0435\u0442 nomina sacra, \u0441\u043e\u043a\u0440\u0430\u0449\u0435\u043d\u043d\u044b\u0435 \u0434\u043e \u0442\u0440\u0435\u0445\u0431\u0443\u043a\u0432\u0435\u043d\u043d\u044b\u0445 \u0444\u043e\u0440\u043c."},
