gPw(){return"\u041f\u043e\u0440\u0444\u0438\u0440\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0435 \u0438 \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 327 \u043b\u0438\u0441\u0442\u043e\u0432 \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u043e 16 \xd7 13 \u0441\u043c. \u042d\u0442\u043e \u043f\u0430\u043b\u0438\u043c\u043f\u0441\u0435\u0441\u0442, \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0439 \u043a\u043e\u043c\u043c\u0435\u043d\u0442\u0430\u0440\u0438\u0439 \u0415\u0432\u0444\u0430\u043b\u0438\u044f \u043a \u0414\u0435\u044f\u043d\u0438\u044f\u043c \u0438 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u044f\u043c \u041f\u0430\u0432\u043b\u0430 \u043d\u0430\u0440\u044f\u0434\u0443 \u0441 \u0431\u0438\u0431\u043b\u0435\u0439\u0441\u043a\u0438\u043c \u0442\u0435\u043a\u0441\u0442\u043e\u043c."},
gPx(){return"\u0422\u0435\u043a\u0441\u0442 \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u043c \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u043f\u043e\u0447\u0435\u0440\u043a\u043e\u043c, \u0440\u0430\u0437\u043c\u0435\u0449\u0451\u043d\u043d\u044b\u043c \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435 \u0441 24 \u0441\u0442\u0440\u043e\u043a\u0430\u043c\u0438, \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0434\u044b\u0445\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0437\u043d\u0430\u043a\u043e\u0432, \u0430\u043a\u0446\u0435\u043d\u0442\u043e\u0432 \u0438 \u0430\u043f\u043e\u0441\u0442\u0440\u043e\u0444\u043e\u0432."},
