gPr(){return"\u0421 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0442\u043e\u0447\u043a\u0438 \u0437\u0440\u0435\u043d\u0438\u044f, \u043a\u043e\u0434\u0435\u043a\u0441 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0441\u043c\u0435\u0448\u0430\u043d\u043d\u044b\u0439 \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442: \u0442\u0435\u043a\u0441\u0442 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u0439 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u041f\u0430\u0432\u043b\u0430 \u0438 \u043e\u0431\u0449\u0438\u0445 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u0439 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u0443\u0435\u0442 \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0430 \u0438 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 III, \u0442\u043e\u0433\u0434\u0430 \u043a\u0430\u043a \u0442\u0435\u043a\u0441\u0442 \u0414\u0435\u044f\u043d\u0438\u0439 \u0438 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u0442\u0438\u043f\u0443 \u0438 \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u0446\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u043a\u0430\u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f V."},
