gPM(){return"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 2066 \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0435 (vellum), \u0447\u0442\u043e \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e \u0434\u043b\u044f \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0435\u0439. \u041e\u043d \u0441\u043e\u0434\u0435\u0440\u0436\u0438\u0442 \u043f\u043e\u043b\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f, \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 20 \u0444\u043e\u043b\u0438\u043e \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0430 (\u043a\u0430\u0436\u0434\u044b\u0439 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 27,5 \xd7 19 \u0441\u043c)."},
gPN(){return"\u0422\u0435\u043a\u0441\u0442 \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u043a\u0430\u0436\u0434\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435, \u043f\u043e 35 \u0441\u0442\u0440\u043e\u043a \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443 \u0438 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e \u043f\u043e 36 \u0431\u0443\u043a\u0432 \u0432 \u0441\u0442\u0440\u043e\u043a\u0435. \u041e\u043d \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u044b\u043c \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u043f\u043e\u0447\u0435\u0440\u043a\u043e\u043c \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c scriptio continua. \u0423\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0431\u0443\u043a\u0432\u044b \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u044b \u0432 \u0441\u0432\u043e\u0435\u043e\u0431\u0440\u0430\u0437\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u0435: \u043e\u043d\u0438 \u043d\u0435\u043c\u043d\u043e\u0433\u043e \u043d\u0430\u043a\u043b\u043e\u043d\u0435\u043d\u044b \u0432\u043f\u0440\u0430\u0432\u043e, \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0442 \u043f\u0440\u043e\u043c\u0435\u0436\u0443\u0442\u043e\u0447\u043d\u043e\u0435 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043c\u0435\u0436\u0434\u0443 \u043a\u0432\u0430\u0434\u0440\u0430\u0442\u043d\u044b\u043c\u0438 \u0438 \u0432\u044b\u0442\u044f\u043d\u0443\u0442\u044b\u043c\u0438 \u0431\u0443\u043a\u0432\u0430\u043c\u0438, \u0430 \u0434\u044b\u0445\u0430\u043d\u0438\u044f \u0438 \u0430\u043a\u0446\u0435\u043d\u0442\u044b \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u044b \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0442\u043e\u0447\u043d\u043e."},
gPL(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u0440\u0430\u043d\u0435\u0435 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u043b\u0430 \u0424\u0438\u043b\u0438\u043f\u043f\u043e \u0412\u0438\u0442\u0430\u043b\u0438\u0438 (1590-1653). \u0422\u0435\u043a\u0441\u0442 \u043a\u043e\u0434\u0435\u043a\u0441\u0430 \u0431\u044b\u043b \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d \u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b\u043e\u043c \u0410\u043d\u0434\u0436\u0435\u043b\u043e \u041c\u0430\u0439 \u0432 1859 \u0433\u043e\u0434\u0443 \u0432 \u0420\u0438\u043c\u0435."},
gPH(){return"\u0413\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u044d\u0442\u043e\u0433\u043e \u043a\u043e\u0434\u0435\u043a\u0441\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u0442\u0438\u043f, \u0442\u0435\u0441\u043d\u043e \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0439 \u0441 \u043c\u0438\u043d\u0443\u0441\u043a\u0443\u043b\u0430\u043c\u0438 61 \u0438 69. \u0410\u043b\u0430\u043d\u0434 \u043e\u0442\u043d\u0435\u0441 \u0435\u0433\u043e \u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 V. \u0423\u043d\u0446\u0438\u0430\u043b 046 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u0439 \u0440\u0430\u043d\u043d\u0435\u0439 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u044c\u044e, \u043e\u0442\u0440\u0430\u0436\u0430\u044e\u0449\u0435\u0439 \u043e\u0441\u043d\u043e\u0432\u043d\u0443\u044e \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u0443\u044e \u0433\u0440\u0443\u043f\u043f\u0443 ('a')."},
