gNH(){return"\u0414\u0430\u043d\u0435 \u043f\u0435\u0440\u0448\u043e\u0434\u0436\u0435\u0440\u0435\u043b\u043e \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043e \u043d\u0430 \u043f\u0430\u043f\u0456\u0440\u0443\u0441\u0456 \u0442\u0430 \u044f\u0432\u043b\u044f\u0454 \u0441\u043e\u0431\u043e\u044e \u0454\u0434\u0438\u043d\u0438\u0439 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 7 \xd7 13 \u0441\u043c, \u044f\u043a\u0438\u0439 \u043f\u0435\u0440\u0432\u0456\u0441\u043d\u043e \u0431\u0443\u0432 \u0447\u0430\u0441\u0442\u0438\u043d\u043e\u044e \u0441\u0443\u0432\u043e\u044e \u0437 \u0442\u0435\u043a\u0441\u0442\u043e\u043c \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f."},
gNI(){return"\u0417\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0443 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u0430\u0440\u043d\u043e\u043c\u0443 \u0441\u0442\u0430\u043d\u0456. \u041f\u0438\u0441\u044c\u043c\u043e \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0435 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u0456 \u0434\u043e\u0431\u0440\u0435 \u0441\u0444\u043e\u0440\u043c\u043e\u0432\u0430\u043d\u0438\u043c \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c \u0448\u0440\u0438\u0444\u0442\u043e\u043c. \u0424\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0431\u0443\u0432 \u0447\u0430\u0441\u0442\u0438\u043d\u043e\u044e \u0441\u0443\u0432\u043e\u044e. \u0411\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0437\u0432\u043e\u0440\u043e\u0442\u043d\u043e\u043c\u0443 \u0431\u043e\u0446\u0456, \u0442\u043e\u0434\u0456 \u044f\u043a \u043d\u0430 \u043b\u0438\u0446\u044c\u043e\u0432\u043e\u043c\u0443 \u0431\u043e\u0446\u0456 \u043c\u0456\u0441\u0442\u0438\u0442\u044c\u0441\u044f \u0456\u043d\u0448\u0438\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442, \u0434\u0430\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043a\u0456\u043d\u0446\u0435\u043c I \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u0430\u0431\u043e \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u043c II \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f."},
