gOL(){return"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 (vellum) \u0437 \u0442\u043e\u043d\u043a\u043e\u0433\u043e \u0439 \u0432\u0438\u0441\u043e\u043a\u043e\u044f\u043a\u0456\u0441\u043d\u043e\u0433\u043e \u043c\u0430\u0442\u0435\u0440\u0456\u0430\u043b\u0443. \u0412\u0456\u043d \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 773 \u0444\u043e\u043b\u0456\u043e \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 32 \xd7 26 \u0441\u043c, \u0441\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0437\u0456\u0431\u0440\u0430\u043d\u0438\u0445 \u0443 \u0437\u043e\u0448\u0438\u0442\u0438 (\u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043f\u043e 8 \u0430\u0440\u043a\u0443\u0448\u0456\u0432 \u0443 \u043a\u043e\u0436\u043d\u043e\u043c\u0443). \u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043f\u043e\u0434\u0456\u043b\u0435\u043d\u0438\u0439 \u043d\u0430 \u0447\u043e\u0442\u0438\u0440\u0438 \u0442\u043e\u043c\u0438: \u0442\u0440\u0438 \u0442\u043e\u043c\u0438 \u043c\u0456\u0441\u0442\u044f\u0442\u044c \u0421\u0435\u043f\u0442\u0443\u0430\u0433\u0456\u043d\u0442\u0443 (\u0421\u0442\u0430\u0440\u0438\u0439 \u0417\u0430\u043f\u043e\u0432\u0456\u0442), \u0430 \u043e\u0434\u0438\u043d \u2013 \u041d\u043e\u0432\u0438\u0439 \u0417\u0430\u043f\u043e\u0432\u0456\u0442."},
gOM(){return"\u0422\u0435\u043a\u0441\u0442 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0438\u0439 \u0435\u043b\u0435\u0433\u0430\u043d\u0442\u043d\u0438\u043c \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c \u043f\u043e\u0447\u0435\u0440\u043a\u043e\u043c \u0433\u0440\u0435\u0446\u044c\u043a\u043e\u044e \u043c\u043e\u0432\u043e\u044e, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u0434\u0432\u0456 \u043a\u043e\u043b\u043e\u043d\u043a\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456, \u043c\u0456\u0441\u0442\u0438\u0442\u044c 49-51 \u0440\u044f\u0434\u043e\u043a \u0443 \u043a\u043e\u043b\u043e\u043d\u0446\u0456 \u0442\u0430 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 20-25 \u043b\u0456\u0442\u0435\u0440 \u0443 \u0440\u044f\u0434\u043a\u0443. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f scriptio continua (\u0431\u0435\u0437 \u043f\u0440\u043e\u0431\u0456\u043b\u0456\u0432). \u041f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0456 \u0440\u044f\u0434\u043a\u0438 \u043a\u043e\u0436\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438 \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u043e \u0447\u0435\u0440\u0432\u043e\u043d\u0438\u043c \u0447\u043e\u0440\u043d\u0438\u043b\u043e\u043c, \u0430 \u0432 \u043a\u0456\u043d\u0446\u0456 \u043a\u043e\u0436\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438 \u0454 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u0456 \xab\u0445\u0432\u043e\u0441\u0442\u0438\xbb. \u0422\u0430\u043a\u043e\u0436 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0437\u043d\u0430\u043a\u0438 \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0456\u0457 \u0442\u0430 \u043f\u0440\u0438\u043c\u0456\u0442\u043a\u0438 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u0456 \u0456\u043d\u0456\u0446\u0456\u0430\u043b\u0438 \u0434\u043b\u044f \u043f\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u043d\u043e\u0432\u043e\u0433\u043e \u0440\u043e\u0437\u0434\u0456\u043b\u0443)."},
gOK(){return"\u041d\u0430\u0437\u0432\u0430 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0443 \u043f\u043e\u0445\u043e\u0434\u0438\u0442\u044c \u0432\u0456\u0434 \u043c\u0456\u0441\u0442\u0430 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u044f \u0432 \u0404\u0433\u0438\u043f\u0442\u0456, \u0434\u0435 \u0432\u0456\u043d \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u0432 \u043f\u0435\u0432\u043d\u0438\u0439 \u0447\u0430\u0441. \u0423 XVII \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445 \u041a\u0438\u0440\u0438\u043b \u041b\u0443\u043a\u0430\u0440\u0438\u0441 \u043f\u0435\u0440\u0435\u0432\u0456\u0437 \u0439\u043e\u0433\u043e \u0437 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0457 \u0434\u043e \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f, \u0430 \u0437\u0433\u043e\u0434\u043e\u043c \u0439\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u043b\u0438 \u041a\u0430\u0440\u043b\u0443 I \u0410\u043d\u0433\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u043c\u0443."},
gOG(){return"\u0417 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0457, \u043a\u043e\u0434\u0435\u043a\u0441 \u043c\u0430\u0454 \u0437\u043c\u0456\u0448\u0430\u043d\u0438\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440: \u0442\u0435\u043a\u0441\u0442 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0439 \u043d\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0434\u043e \u0432\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 (\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u044f III), \u0442\u043e\u0434\u0456 \u044f\u043a \u0440\u0435\u0448\u0442\u0430 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443 \u0432\u0456\u0434\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0434\u043e \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 (\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u044f I)."},
gOI(){return"\u041d\u0430\u0440\u0430\u0437\u0456 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u044c\u043a\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 \u0432 \u041b\u043e\u043d\u0434\u043e\u043d\u0456 \u0456 \u0432\u0438\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0439 \u0443 \u0433\u0430\u043b\u0435\u0440\u0435\u0457 \u0456\u043c\u0435\u043d\u0456 \u0414\u0436\u043e\u043d\u0430 \u0420\u0438\u0442\u0431\u043b\u0430\u0442\u0430 \u043f\u043e\u0440\u044f\u0434 \u0456\u0437 \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u0438\u043c \u043a\u043e\u0434\u0435\u043a\u0441\u043e\u043c."},
